      },
      {
        path:'products/wu/ping',
        component: WuPing,
        name:'WuPing'
      },
      {
        path:'products/wu/taylormade',
        component: WuTaylor,
        name:'WuTaylor'
      },
      {
        path:'products/wu/pxg',
        component: WuPxg,
        name:'WuPxg'
      },
      {
        path:'products/wu/titleist',
